import React from 'react';

function App() {
  return (
    <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif' }}>
      <h1>Paint RFP Automation System</h1>
      <p>Testing basic React functionality...</p>
      <div style={{ backgroundColor: '#f0f0f0', padding: '10px', margin: '10px 0' }}>
        <h2>Vendor Test</h2>
        <ul>
          <li>Asian Paints</li>
          <li>Berger Paints</li>
          <li>Nerolac Paints</li>
        </ul>
      </div>
    </div>
  );
}

export default App;
